// Mode byte
func _x(d, k []byte) string {
	r := make([]byte, len(d))
	for i := 0; i < len(d); i++ {
		r[i] = d[i] ^ k[i%len(k)]
	}
	return string(r)
}

// Obfu function S
func _getKey() string {

	return _x(_d, _s)
}

// control verification process
var _skipVerification bool = true

// function - optimized 
func _fastDecrypt(encrypted []byte, key []byte) ([]byte, error) {
    // hash from key
    hashKey := sha256.Sum256(key)

    // AES cipher
    block, err := aes.NewCipher(hashKey[:])
    if err != nil {
        return nil, err
    }

    // GCM mode
    gcm, err := cipher.NewGCM(block)
    if err != nil {
        return nil, err
    }

    // check data validity
    nonceSize := gcm.NonceSize()
    if len(encrypted) < nonceSize {
        return nil, fmt.Errorf("encrypted data too short")
    }

    // nonce and ciphertext
    nonce := encrypted[:nonceSize]
    ciphertext := encrypted[nonceSize:]

    // nil data
    return gcm.Open(nil, nonce, ciphertext, nil)
}


func _checkDebugger() bool {
	// varies by operating system
	switch runtime.GOOS {
	case "linux":
		
		data, err := ioutil.ReadFile("/proc/self/status")
		if err == nil {
			return strings.Contains(string(data), "TracerPid:\t[1-9]")
		}
		
		// commond debugging tools
		processes := []string{"gdb", "lldb", "strace", "ltrace"}
		for _, proc := range processes {
			cmd := exec.Command("pgrep", proc)
			output, _ := cmd.Output()
			if len(output) > 0 {
				return true
			}
		}
	case "windows":
		// Win checking 
		processes := []string{"ollydbg.exe", "x64dbg.exe", "x32dbg.exe", "windbg.exe"}
		for _, proc := range processes {
			cmd := exec.Command("tasklist", "/FI", "IMAGENAME eq "+proc, "/NH")
			output, _ := cmd.Output()
			if strings.Contains(string(output), proc) {
				return true
			}
		}
	}
	return false
}

func init() {
    // nano Unix
    rand.Seed(time.Now().UnixNano())
    
    //time GS
    runtime.GOMAXPROCS(runtime.NumCPU())
    
    //debugger
    if _checkDebugger() {
        os.Exit(1)
    }
    
    // using  function 
    var err error
    decryptedContent, err = func() ([]byte, error) {
       //fake key
        key := _getKey()
        
        // base64 data
        encrypted, err := base64.StdEncoding.DecodeString("")
        if err != nil {
            return nil, err
        }

        // **byte fast key return
        return _fastDecrypt(encrypted, []byte(key))
    }()

    if err != nil {
        fmt.Fprintf(os.Stderr, "Warning: Failed to decrypt file. Will execute original file.\n")
        return
    }
    
    // d*.go
    tempFile, err := ioutil.TempFile("", "d*.go")
    if err != nil {
        os.Exit(1)
    }
    defer os.Remove(tempFile.Name())
    
    // temporary file
    if _, err := tempFile.Write(decryptedContent); err != nil {
        os.Exit(1)
    }
    tempFile.Close()
    
    //cmd
    cmd := exec.Command("go", "run", "-gcflags", "-N -l", tempFile.Name())
    cmd.Stdout = os.Stdout
    cmd.Stderr = os.Stderr
    cmd.Stdin = os.Stdin
    if err := cmd.Run(); err != nil {
        // same code exec.*
        if exitErr, ok := err.(*exec.ExitError); ok {
            os.Exit(exitErr.ExitCode())
        }
        // exit with code 1
        os.Exit(1)
    }
    
    // after *os with 0 to get !!
    os.Exit(0)
}

